import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Bar } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend
} from 'chart.js';

// Register necessary components
ChartJS.register(
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend
);

const Container = styled.div`
  width: 80%;
  margin: 0 auto;
  padding: 2rem;
  background-color: #ffffff;
  border-radius: 8px;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
`;

const TitleStyled = styled.h2`
  text-align: center;
  color: #333;
  margin-bottom: 1rem;
`;

const Input = styled.input`
  display: block;
  width: 100%;
  padding: 0.5rem;
  margin-bottom: 1rem;
  border: 1px solid #ccc;
  border-radius: 4px;
`;

const PaginationContainer = styled.div`
  display: flex;
  justify-content: center;
  margin-top: 1rem;
`;

const Button = styled.button`
  padding: 0.5rem 1rem;
  margin: 0 0.5rem;
  font-size: 1rem;
  color: #fff;
  background-color: #007bff;
  border: none;
  border-radius: 4px;
  cursor: pointer;

  &:hover {
    background-color: #0056b3;
  }

  &:disabled {
    background-color: #ddd;
    cursor: not-allowed;
  }
`;

const Message = styled.p`
  text-align: center;
  color: #666;
  font-size: 1.2rem;
`;

function CustomerLifetimeValueChart() {
  const [chartData, setChartData] = useState(null);
  const [search, setSearch] = useState('');
  const [page, setPage] = useState(1);
  const [totalPages, setTotalPages] = useState(1);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchCustomerLifetimeValue = async () => {
      setLoading(true);
      setError(null);

      try {
        const response = await axios.get(`${process.env.REACT_APP_API_URL}/api/shopify/customer-lifetime-value`, {
          params: { page, limit: 10, search }
        });
        const data = response.data || [];

        if (data.length === 0) {
          setChartData({
            labels: [],
            datasets: [
              {
                label: 'Total Spent',
                data: [],
                backgroundColor: 'rgba(75,192,192,0.6)',
                borderColor: 'rgba(75,192,192,1)',
              },
            ],
          });
          setTotalPages(1);
        } else {
          const labels = data.map((item) => `${item.firstName} ${item.lastName}`);
          const values = data.map((item) => item.totalSpent);

          setChartData({
            labels,
            datasets: [
              {
                label: 'Total Spent',
                data: values,
                backgroundColor: 'rgba(75,192,192,0.6)',
                borderColor: 'rgba(75,192,192,1)',
              },
            ],
          });

          // Assuming pagination info is included in response
          const pagination = response.data.pagination || {};
          setTotalPages(pagination.totalPages || 1);
        }
      } catch (error) {
        console.error('Error fetching customer lifetime value data', error);
        setError('Error fetching data. Please try again later.');
        setChartData(null);
      } finally {
        setLoading(false);
      }
    };

    fetchCustomerLifetimeValue();
  }, [page, search]);

  const handleSearchChange = (event) => {
    setSearch(event.target.value);
    setPage(1); // Reset to first page on search
  };

  const handlePageChange = (newPage) => {
    setPage(newPage);
  };

  if (loading) {
    return <Message>Loading chart data...</Message>;
  }

  if (error) {
    return (
      <Container>
        <Message>{error}</Message>
      </Container>
    );
  }

  return (
    <Container>
      <TitleStyled>Customer Lifetime Value</TitleStyled>
      <Input 
        type="text" 
        placeholder="Search by name or email" 
        value={search} 
        onChange={handleSearchChange} 
      />
      {chartData && <Bar data={chartData} />}
      <PaginationContainer>
        <Button onClick={() => handlePageChange(page - 1)} disabled={page === 1}>
          Previous
        </Button>
        <span>Page {page} of {totalPages}</span>
        <Button onClick={() => handlePageChange(page + 1)} disabled={page === totalPages}>
          Next
        </Button>
      </PaginationContainer>
    </Container>
  );
}

export default CustomerLifetimeValueChart;
